import React, { useState, useEffect } from 'react';
import Card from './components/Card';
function App() {
  const [animeList, setAnimeList] = useState([]);

  useEffect(() => {
    const fetchAnime = async () => {
      const response = await fetch('https://api.jikan.moe/v4/anime?q=Naruto&order_by=title&sort=asc&limit=5');
      const data = await response.json();
      setAnimeList(data.results);
    };

    fetchAnime();
  }, []);

  return (
    <div>
      {animeList && animeList.length > 0 ? (
        <div className="card-container">
          {animeList.map(anime => (
            console.log(anime.title),
            <Card title={anime.title} description={anime.synopsis} image={anime.image_url} />
          ))}
        </div>
      ) : (
        <p>No anime found</p>
      )}

    </div>
  );
}

export default App;
